['#include <stdio.h>
#include <string.h>

char s[50005];
int cnt, f[256];

void inc(char c) {
    if (c == '?') {
        cnt++;
        return;
    }
    if (!f[c])
        cnt++;
    f[c]++;
}

void dec(char c) {
    if (c == '?') {
        cnt--;
        return;
    }
    f[c]--;
    if (!f[c])
        cnt--;
}

char fc() {
    char c;
    for (c = 'A'; c <= 'Z'; c++)
        if (!s[c]) {
            s[c]++;
            return c;
        }
    return '.';
}

void output(int b, int e, int n) {
    int i;
    for (i = 0; i < b; i++)
        if (s[i] == '?')
            s[i] = 'Z';
    for (i = e+1; i < n; i++)
        if (s[i] == '?')
            s[i] = 'Z';
    for (i = b; i <= e; i++)
        if (s[i] == '?')
            s[i] = fc();
    puts(s);
}

int main(int argc, char* argv[]) {
    int i, j, n;

    gets(s);
    n = strlen(s);

    if (n <= 25) {
        puts("-1");
        return 0;
    }

    memset(f, 0, sizeof f);
    cnt = 0;
    for (i = 0; i < 26; i++)
        inc(s[i]);

    if (cnt == 26) {
        output(0, 25, n);
        return 0;
    }

    for (i = 0, j = 26; j < n; i++, j++) {
        dec(s[i]);
        inc(s[j]);
        if (cnt == 26) {
            output(i+1, j, n);
            return 0;
        }
    }

    puts("-1");
    return 0;
}
']

