['#include<stdio.h>
int main()
{
    int i,n,c,count=0,a[10000];
    scanf("%d %d",&n,&c);
    for(i=1; i<=n; i++)
    {
        scanf("%d",&a[i]);
    }
    for(i=n; i>0; i--)
    {
        if(a[i]-a[i-1]<=c)
            count++;
        if(a[i]-a[i-1]>c)
        {
            break;
        }
    }
    printf("%d\n",count+1);
    return 0;
}
