['#include<stdio.h>
#include<stdlib.h>

int cf(void const *a, void const *b)
{
	return (*(int*)a) - (*(int*)b);
}
int main()
{
	int n, c, i, r=0, k;
	
	scanf("%d %d", &n, &c);
	int a[n];
	
	for(i=0; i<n; i++)
	{
		scanf("%d", &a[i]);
	}
	qsort(a, n, sizeof(int), cf);
	
	for(k=n-1; k>0; k--)
	{
		r++;
		
		if(a[k]-a[k-1]>c)
		{
			break;
		}
	}
	printf("%d", r);
	
	return 0;
}']

