['#include<stdio.h>
#include<stdlib.h>

void screen_words (int *time, int *words_on_screen, int crazy_time);

int main()
{
	int no_of_words, crazy_time;
	scanf("%d %d", &no_of_words, &crazy_time);
	//printf("%d", ++1); not possible.
	int time = 0;
	int words_on_screen = 0;
	while (0<no_of_words--)
	{
		screen_words (&time, &words_on_screen, crazy_time);//recursive - screen_words (&time, &words_on_screen, no_of_words); we could probably even print with just this.
	}
	printf("\n%d", words_on_screen);
	return 0;
}

void screen_words (int *time, int *words_on_screen, int crazy_time)
{
	int word_input_time;
	scanf("%d", &word_input_time);
	if (word_input_time - (*time) > crazy_time)
	{
		*words_on_screen = 1;
	}
	else
	{
		*words_on_screen += 1;
	}
	*time = word_input_time;
	return ;
}
']

