				int flag=1;
				for (int k=0;k<26;k++) {
					if (counter[k]==0) flag=0;
					counter[k]=0;
				}
				p=0;
				if (flag) answer=1;
				j=26+i;
				continue;
			}
			if (s[i]=='?') {
				int flag=0;
				for (int k=0;k<26;k++) {
					if (!counter[k]) {
						s[i]=k+'A';
						counter[k]=1;
						flag=1;
						break;
					}
				}
				if (!flag) s[i]='A';
			}
			if (s[j]=='?') {
				int flag=0;
