		int ans=0;
		for (int i=0,j=25;i<len,j<len;i++,j++) {
			int counter[26];
			for (int k=0;k<26;k++) counter[k]=0;
			int q=0, a=0, flag=1;
			for (int k=i;k<=j;k++) {
				if (s[k]=='?') q++;
				else {
					if (!counter[s[k]-'A']) {
						counter[s[k]-'A']=1;
						a++;
					}
					else {
						flag=0;
						break;
					}
				}
			}
			if (flag) {
				if (a+q==26) {
					ans=1;
					for (int k=i;k<=j;k++) {
						if (s[k]=='?') {
							for (int l=0;l<26;l++) {
								if (!counter[l]) {
									s[k]=l+'A';
									counter[l]=1;
									break;
								}
							}
						}
					}
				}
			}
			if (ans) break;
		}
		for (int i=0;i<len;i++) {
			if (s[i]=='?') s[i]='A';
		}
		if (ans) printf("%s\n", s);
		else printf("-1\n");
	}
}
